import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row'
import Nav from 'react-bootstrap/Nav';
import Col from 'react-bootstrap/Col'
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';
import 'bootstrap/dist/css/bootstrap.min.css';

function BasicExample() {
  return (
    <Navbar expand="lg"  className = 'm-3' >
       <Row>
        <Col md = {6}>
        <Navbar.Brand href="#home" style = {{fontFamily: 'Sacramento, cursive', fontSize: '3rem'}}>Fahad Al-Araik</Navbar.Brand>
        </Col>


       <Col md = {6}>


          <Navbar.Collapse id="basic-navbar-nav" className="justify-content-end" style = {{marginRight:'50px'}}>
          <Navbar.Toggle aria-controls="basic-navbar-nav" />
          <Nav className = 'pl-3 pr-3' style = {{fontSize:'1.5rem'}} >

            <Nav.Link href="#home" className='active' id = 'navbar-item' >[Home]</Nav.Link>

            <Nav.Link href="#about-me" id = 'navbar-item' >About Me</Nav.Link>

            <Nav.Link href="#skills" id = 'navbar-item' >Skills</Nav.Link>

            <Nav.Link href="#certificates" id = 'navbar-item' >Certificates</Nav.Link>

            <Nav.Link href="#projects" id='navbar-item'>Projects</Nav.Link>
          </Nav>

            </Navbar.Collapse> 


       </Col>
      </Row>





    </Navbar>
  );
}

export default BasicExample;
